import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

    title: {

        flex: .5,
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        width: '80%',
    },

    text: {

        color: '#fff',
        fontSize: 24,
        fontFamily: 'spotifyFont',
        padding: 1
    },

    nome: {

        color: '#bda9a8',
        fontSize: 18,
        fontFamily: '',
    },


})
